import { Box, Link, Stack, styled, Typography } from "@mui/material";
//import axios from "axios";
import { useState } from "react";

import Breakfast from "../../static/categories/breakfast.jpg";
import Dinner from "../../static/categories/dinner.jpg";
import Salad from "../../static/categories/salad.jpg";
import Holiday from "../../static/categories/holiday.jpg";
import Vegetarian from "../../static/categories/vegetarian.jpg";
import Dessert from "../../static/categories/dessert.jpg";

const Category = () => {
  const [cat, setCat] = useState([]);

  const StyledCard = styled(Box)(({ theme }) => ({
    display: "flex",
    justifyContent: "center",
    backgroundRepeat: "no-repeat",
    backgroundPosition: "center",
    backgroundSize: "cover",
    borderRadius: "100%",
    overflow: "hidden",
    width: "100px",
    cursor: "pointer",
    [theme.breakpoints.up("md")]: {
      height: 100,
    },
    [theme.breakpoints.down("md")]: {
      height: 100,
    },
    "&:hover": {
      opacity: 0.8,
      boxSizing: "borderBox",
      zIndex: 1,
      transition: `all 0.45s ease`,
    },
  }));
  const StyledTypography = styled(Typography)({
    textAlign: "center",
    color: "black",
    fontSize: 20,
  });
  const CardBox = styled(Box)({
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    flexDirection: "column",
  });
  return (
    <Stack
      Container
      direction={"row"}
      mt={4}
      spacing={3}
      ml={3}
      sx={{ maxWidth: "100%", overflow: "auto" }}
    >
      <Link href="category/1" sx={{ textDecoration: "none" }}>
          <CardBox>
            <StyledCard sx={{ backgroundImage: `url(${Breakfast})` }} />
            <StyledTypography>Breakfast</StyledTypography>
          </CardBox>
        </Link>
        <Link href="category/2" sx={{ textDecoration: "none" }}>
          <CardBox>
            <StyledCard sx={{ backgroundImage: `url(${Dinner})` }} />
            <StyledTypography>Dinner</StyledTypography>
          </CardBox>
        </Link>
        <Link href="category/3" sx={{ textDecoration: "none" }}>
          <CardBox>
            <StyledCard sx={{ backgroundImage: `url(${Salad})` }} />
            <StyledTypography>Salad</StyledTypography>
          </CardBox>
        </Link>
        <Link href="category/4" sx={{ textDecoration: "none" }}>
          <CardBox>
            <StyledCard sx={{ backgroundImage: `url(${Holiday})` }} />
            <StyledTypography>Holiday</StyledTypography>
          </CardBox>
        </Link>
        <Link href="category/5" sx={{ textDecoration: "none" }}>
          <CardBox>
            <StyledCard sx={{ backgroundImage: `url(${Vegetarian})` }} />
            <StyledTypography>Vegetarian</StyledTypography>
          </CardBox>
        </Link>
        <Link href="category/6" sx={{ textDecoration: "none" }}>
          <CardBox>
            <StyledCard sx={{ backgroundImage: `url(${Dessert})` }} />
            <StyledTypography>Dessert</StyledTypography>
          </CardBox>
        </Link>
    </Stack>
  );
};

export default Category;
